package ezcode;

public class floatdouble {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int myInt = 5/2;
	System.out.println(myInt);	
		float myFloat = 5f/3;
	System.out.println(myFloat);
		double myDouble =5.0/3;
	System.out.println(myDouble);
	}

}
